import React, {Component} from 'react';

function getRepoThunk() {
    return componentDidMount = () => {
        let result = fetch('https://api.github.com/repositories',{ method: 'GET'})
          .then(response => {
              return response.json();
          })
          .then(response =>{
            console.log(response);
          })
          .catch((error) => {
            console.error(error,"ERRRRRORRR");
          });         
    }
}
export default getRepoThunk
